// ];

// let rows = [];

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      rows: [],
    };
  }

  componentDidMount() {
    this.loadData();
  }

  loadData() {
    fetch("http://localhost:8801/design/users/getAllUsers", {
      method: "GET",
      mode: "no-cors",
      cache: "no-cache",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((res) => res.json())
      .then(
        (result) => {
          console.log("data = " + result);
          this.setState({
            rows: result,
          });
        },
        (error) => {
          // do nothing
        }
      );
  }
  render() {
    const rows = this.state.rows;
    return (
      <div className="App">
        <header className="App-header">
          <p>Jesus Lorca Luque 2</p>
          <UsersTable rows={rows} />
        </header>
      </div>
    );
  }
}

export default App;
